Candelabra
~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~

Synopsis: Amanda (Kaylani Lei) celebrates her birthday on a dark and rainy night with her boyfriend Charlie. After they make love and drift off to , she wakes up alone. After searching for him, she goes to the bathroom and is caught in a surreal time warp where her apartment morphs into the same place - 70 years ago. Now it's 1937 and we see a couple there - Greg and Laura - where we witness a strange scene of depraved sexual behavior.When Kaylani wakes up in her modern day apartment again, she thinks it was all just a dream. But her outlook changes when she meets a visitor from the past, Redman - a carnival barker from 1937. He helps put the pieces together so she can find Charlie and bring him back...with the use a candelabra of some unusual magic they travel back in time and unravel the mysteries of this curious dimension.

